Within a binary crate, here's the organization that's recommended . my-app/src/command.rs: //! Contains command parsers and logic. use clap::Parser; #[derive(Debug, Parser)]
pub struct MyApp { // Options, subcommands etc #[clap(short, long, default_value_t)] my_arg: usize,
} impl MyApp { pub fn exec(self) -> color_eyre::Result<()> { println!("The value of my-arg is {}", self.my_arg); Ok(()) }
} my-app/src/lib.rs: //! Help text for my-app.
//!
//! Can contain information about what the binary does, command-line options,
//! configuration, etc. mod command;
// ... other modules // This is the only export from the crate. It is marked hidden and
// is not part of the public API.
#[doc(hidden)]
pub use command::MyApp; my-app/src/bin/my-app.rs: use clap::Parser;
use my_app::MyApp; fn main() -> color_eyre::Result<()> { color_eyre::install()?; let my_app = MyApp::parse(); my_app.exec()
} Notes: Most of the logic is within command.rs. In general, you should keep lib.rs as minimal as possible, unless your entire library fits in it. That's because all methods and fields in lib.rs are visible to the entire library---code in the top-level module cannot be marked private to the rest of the module. There's a lib.rs separate from the my-app.rs that contains main. There are several advantages to having a lib.rs. In particular, rustdoc doesn't use standard privacy rules if building documentation from main.rs, so private modules are visible in the public documentation. Only the top-level MyApp is exported. The top-level MyApp is all main.rs should generally need to care about. MyApp is marked #[doc(hidden)]. The details of MyApp are only meant to be seen by main. The library is not part of the public API. Only the command-line interface is. src/bin/my-app.rs instead of src/main.rs. While src/main.rs works just as well, src/bin makes it harder to accidentally import library code with mod statements.

