This pattern is usually presented in examples and tutorials. It is conceptually quite simple. Here's an example of what it looks like: # #![allow(dead_code)]
// The owo-colors "supports-colors" feature must be enabled.
use clap::{ArgEnum, Parser};
use owo_colors::{OwoColorize, Stream}; #[derive(Debug, Parser)]
struct MyApp { #[clap(long, arg_enum, global = true, default_value = "auto")] color: Color,
} #[derive(ArgEnum, Clone, Copy, Debug)]
enum Color { Always, Auto, Never,
} impl Color { fn init(self) { // Set a supports-color override based on the variable passed in. match self { Color::Always => owo_colors::set_override(true), Color::Auto => {} Color::Never => owo_colors::set_override(false), } }
} fn main() { let app = MyApp::parse(); app.color.init(); println!( "My number is {}", 42.if_supports_color(Stream::Stdout, |text| text.bright_blue()) );
} Notes: owo_colors::set_override is used to control color support globally. The global configuration only has an effect if if_supports_color is called. println! is paired with Stream::Stdout. If this were eprintln!, it would need to be paired with Stream::Stderr. While this pattern is sometimes convenient in binary code, it should not be used in libraries. That is because libraries should not print information directly out to stdout or stderr—instead, they should return values that implement Display or similar. Library code should use the stylesheet approach instead.

