This pattern involves defining a Styles struct containing colors and styles to apply to a text. A stylesheet is simply a list of dynamic styles, customized to a particular type to be displayed. Here's an example: # use std::fmt;
use owo_colors::{OwoColorize, Style}; // Stylesheet used to colorize MyValueDisplay below.
#[derive(Debug, Default)]
struct Styles { number_style: Style, shape_style: Style, // ... other styles
} impl Styles { fn colorize(&mut self) { self.number_style = Style::new().bright_blue(); self.shape_style = Style::new().bright_green(); // ... other styles }
}
# # #[derive(Debug)]
# pub struct MyValue {
# number: usize,
# shape: &'static str,
# }
# # impl MyValue {
# pub fn new(number: usize, shape: &'static str) -> Self {
# Self { number, shape }
# }
# # /// Returns a type that can display `MyValue`.
# pub fn display(&self) -> MyValueDisplay<'_> {
# MyValueDisplay {
# value: self,
# styles: Box::new(Styles::default()),
# }
# }
# }
# # /// Displayer for [`MyValue`].
# pub struct MyValueDisplay<'a> {
# value: &'a MyValue,
# styles: Box<Styles>,
# }
# # impl<'a> MyValueDisplay<'a> {
# /// Colorizes the output.
# pub fn colorize(&mut self) {
# self.styles.colorize();
# }
# }
# # impl<'a> fmt::Display for MyValueDisplay<'a> {
# fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
# write!(
# f,
# "My number is {}, and my shape is a {}",
# self.value.number.style(self.styles.number_style),
# self.value.shape.style(self.styles.shape_style),
# )
# }
# } Here's some library code that uses the above stylesheet: # use std::fmt;
# use owo_colors::{OwoColorize, Style};
# # // Stylesheet used to colorize MyValueDisplay below.
# #[derive(Debug, Default)]
# struct Styles {
# number_style: Style,
# shape_style: Style,
# // ... other styles
# }
# # impl Styles {
# fn colorize(&mut self) {
# self.number_style = Style::new().bright_blue();
# self.shape_style = Style::new().bright_green();
# // ... other styles
# }
# }
# #[derive(Debug)]
pub struct MyValue { number: usize, shape: &'static str,
} impl MyValue { pub fn new(number: usize, shape: &'static str) -> Self { Self { number, shape } } /// Returns a type that can display `MyValue`. pub fn display(&self) -> MyValueDisplay<'_> { MyValueDisplay { value: self, styles: Box::new(Styles::default()), } }
} /// Displayer for [`MyValue`].
pub struct MyValueDisplay<'a> { value: &'a MyValue, styles: Box<Styles>,
} impl<'a> MyValueDisplay<'a> { /// Colorizes the output. pub fn colorize(&mut self) { self.styles.colorize(); }
} impl<'a> fmt::Display for MyValueDisplay<'a> { fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result { write!( f, "My number is {}, and my shape is a {}", self.value.number.style(self.styles.number_style), self.value.shape.style(self.styles.shape_style), ) }
} And finally, here's the binary code that uses the library. # #![allow(dead_code)]
# use clap::{ArgEnum, Parser};
# use my_app::MyValue;
# use owo_colors::Stream;
# # #[derive(Debug, Parser)]
# struct MyApp {
# #[clap(long, arg_enum, global = true, default_value = "auto")]
# color: Color,
# }
# # #[derive(ArgEnum, Clone, Copy, Debug)]
# enum Color {
# Always,
# Auto,
# Never,
# }
# // This example uses the supports-color crate:
// https://crates.io/crates/supports-color
//
// MyApp and Color definitions are repeated from the "immediate pattern"
// example above. impl Color { fn supports_color_on(self, stream: Stream) -> bool { match self { Color::Always => true, Color::Auto => supports_color::on_cached(stream).is_some(), Color::Never => false, } }
} fn main() { let app = MyApp::parse(); let my_value = MyValue::new(24, "circle"); let mut display = my_value.display(); if app.color.supports_color_on(Stream::Stdout) { display.colorize(); } println!("{}", display);
} Notes: Library code is completely unaware of whether the environment supports colors. All it cares about is whether the colorize method is called. Note that the global set_override and unset_override methods have no impact on library code in the stylesheet example. The global methods are only active if if_supports_color is called, as shown by the example for the immediate pattern above. This is by design: most libraries shouldn't reach out to global state. The stylesheet is stored as Box<Styles>. The boxing isn't strictly required, but each Style is pretty large, and a struct containing e.g. 16 styles is 272 bytes as of owo-colors 3.2.0. That's a pretty large amount of data to store on the stack. Styles::default() initializes all the styles to having no effect. The colorize() method then initializes them as required. For custom color support, Styles can be made public. Most library code won't need to give users the ability to customize styles, but this pattern naturally extends to that use case. Use of a separate MyAppDisplay type. The colorize call is isolated to this particular MyAppDisplay, without influencing other display calls. println! is paired with Stream::Stdout. If this were eprintln!, it would need to be paired with Stream::Stderr.

